// Import des éléments React
import { Link } from 'react-router-dom'

// Import des composant
import HousingCards from '../components/HousingCards.js'

// Import des élément de style
import '../styles/stylePages/Home.css'

// Import des assets
import BannerXL from '../assets/bannerHomeXL.png'
import BannerS from '../assets/bannerHomeS.png'

function Home () {
  return (
    <main>
      <div id='title'>
        <img
          id='title-bannerXL'
          src={BannerXL}
          alt='Bannière avec un paysage'
        />

        <img id='title-bannerS' src={BannerS} alt='Bannière avec un paysage' />
        <div id='title-bg'></div>
        <h1 id='title-home'>Chez vous, partout et ailleurs</h1>
      </div>

      {/* Utilisation de la méthode map pour créer un nouveau tableau "card" à partir du fichier JSON*/}
      <div id='housing'>
        {housing.map(cards => (
          <Link
            className='housing-link'
            key={`${cards.id}`}
            to={`/housing/${cards.id}`}
          >
            <HousingCards
              key={`${cards.id}`}
              cover={cards.cover}
              title={cards.title}
            />
          </Link>
        ))}
      </div>
    </main>
  )
}

export default Home
